import { useEffect, useState } from 'react';
import '../App.css';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
function ReceiptList(){

    const [ticket,setTicket]=useState()



    useEffect(()=>{
    fetch("http://localhost:8080/ticket",{
        method:"GET"
    })
    .then((res=>res.json()))
    .then((data)=>{

        const {content}=data


        setTicket(content)

    })


    },[])
    console.log(ticket)
    return(
        <>

        <DataTable value={ticket} tableStyle={{ minWidth: '50rem' }}>
                <Column 
                field="id"
                 header="Code"/>
                <Column
                    header="Custom Name"
                    body={(rowData) => (
                        <>
                            {rowData.firstName} {rowData.lastName}
                        </>
                    )}
                />
                <Column field="user.department" header="Departament"></Column>
                <Column field="user.ticketState" header="Quantity"></Column>
        </DataTable>

        </>)

    }
export default ReceiptList;
